import React from "react";
import { Menu, Segment, Container, Grid } from "semantic-ui-react";

export default () => {
  return (
    <Segment
      inverted
      style={{ margin: "5em 0em 0em", padding: "5em 0em" }}
      vertical
    >
      <Container>
        <Grid columns={4} divided>
          <Grid.Row></Grid.Row>
        </Grid>
      </Container>
    </Segment>
  );
};
